["room_des_100201"] = New("room_des_100201","设备齐全的击球训练室，这一个成熟的俱乐部的起点。","A well-equipped batting training room will be the starting point for any promising club.","ちゃんと整備されたバッティングルームは良いクラブへのスタートポイント。","設備齊全的擊球訓練室，這一個成熟的俱樂部的起點。","Ein gut ausgestatteter Schlagtrainingssaal ist der Ausgangspunkt für jeden vielversprechenden Club.","Хорошо оборудованный зал для тренировок с битами станет отправной точкой для любого перспективного клуба.","Une salle d'entraînement à la batte bien équipée sera le point de départ de tout club prometteur.","Una sala di allenamento di battuta ben attrezzata sarà il punto di partenza di ogni club promettente.","Una sala de entrenamiento de bateo bien equipada será el punto de partida de cualquier club prometedor.","Uma sala de treino de tacos bem equipada será o ponto de partida para qualquer clube promissor.",""),
["room_des_100301"] = New("room_des_100301","老板说的都对！老板的指示一定要执行到底！为了老板的理想前进！","The boss is always right. Follow his instructions and fight for his dream！","社長の言うことは全て正しいです。社長の言うままに社長の理想を叶えるため進みましょう！","老闆說的都對！老闆的指示一定要執行到底！為了老闆的理想前進！","Der Boss hat immer Recht. Befolge seine Anweisungen und kämpfe für seinen Traum！","Босс всегда прав. Следуйте его указаниям и боритесь за свою мечту.","Le patron a toujours raison. Suivez ses instructions et battez-vous pour son rêve！","Il capo ha sempre ragione. Segui le sue istruzioni e combatti per il suo sogno!","El jefe siempre tiene razón. Sigue sus instrucciones y lucha por su sueño！.","O chefe está sempre certo. Siga as suas instruções e lute pelo seu dream！",""),
["room_des_100401"] = New("room_des_100401","让图谋不轨的人闻风丧胆的保卫处。","This security office will keep troublemakers away.","怪しい人を拒むための警備センター。","讓圖謀不軌的人聞風喪膽的保衛處。","Dieses Sicherheitsbüro wird Störenfriede fernhalten.","Этот кабинет охраны будет держать нарушителей спокойствия на расстоянии.","Ce bureau de sécurité éloignera les fauteurs de trouble.","Questo ufficio di sicurezza terrà lontani i piantagrane.","Esta oficina de seguridad mantendrá alejados a los alborotadores.","Este gabinete de segurança manterá os arruaceiros afastados.",""),
["room_des_100501"] = New("room_des_100501","工具间里一把趁手的工具能让修理工开心上好久。","A handy tool in the tool room can keep the mechanic happy for a long time.","整備士は道具の間の使いやすい道具に喜ぶでしょう。","工具間裡一把趁手的工具能讓修理工開心上好久。","Ein handliches Werkzeug im Werkzeugraum kann den Mechaniker für lange Zeit bei Laune halten.","Удобный инструмент в инструментальной комнате может долгое время радовать механика.","Un outil pratique dans la salle des outils peut rendre le mécanicien heureux pendant longtemps.","Un attrezzo pratico nella stanza degli attrezzi può rendere felice il meccanico per molto tempo.","Una práctica herramienta en el cuarto de herramientas puede mantener contento al mecánico durante mucho tiempo.","Uma ferramenta útil na sala de ferramentas pode manter o mecânico feliz durante muito tempo.",""),
["room_des_100601"] = New("room_des_100601","整洁干净的保洁室能让人心情舒畅。","A clean and tidy janitor room is always delightful.","キレイな清掃室は人の気分をよくします。","整潔乾淨的保洁室能讓人心情舒暢。","Ein sauberer und aufgeräumter Hausmeisterraum ist immer erfreulich.","Чистая и опрятная комната уборщика всегда радует.","Une salle de concierge propre et bien rangée est toujours délicieuse.","Una stanza degli inservienti pulita e ordinata è sempre piacevole.","Una sala de conserjería limpia y ordenada siempre es encantadora.","Uma sala de manutenção limpa e arrumada é sempre encantadora.",""),
["room_des_100701"] = New("room_des_100701","财务室的大门后藏着凑在一起八卦的收银员们。","Hidden behind the door of the financial office are cashiers who are clinging together to gossip.","財務室の中に、ウワサ好きなスタッフが集まっています。","財務室的大門後藏著湊在一起八卦的收銀員們。","Hinter der Tür des Finanzbüros verstecken sich Kassiererinnen, die sich zum Tratschen zusammenraufen.","За дверью финансового офиса прячутся кассиры, которые прижимаются друг к другу, чтобы посплетничать.","Cachées derrière la porte du bureau financier, des caissières se serrent les coudes pour commérer.","Nascosti dietro la porta dell'ufficio finanziario ci sono cassieri che si aggrappano per spettegolare.","Detrás de la puerta de la oficina financiera se esconden las cajeras que se aferran a los chismes.","Escondidos atrás da porta do escritório financeiro estão os caixas que se agarram a mexericos.",""),
["room_des_100801"] = New("room_des_100801","啦啦队员们宝贵的休息时间就在这里度过。","This is where the cheerleaders spend their precious downtime.","応援団は貴重な休憩時間をここで過ごします。","啦啦隊員們寶貴的休息時間就在這裡度過。","Hier verbringen die Cheerleader ihre kostbare Auszeit.","Именно здесь чирлидеры проводят свое драгоценное время простоя.","C'est ici que les pom-pom girls passent leur précieux temps mort.","Qui è dove le cheerleader trascorrono il loro prezioso tempo libero.","Aquí es donde las animadoras pasan su precioso tiempo de inactividad.","É aqui que as cheerleaders passam o seu precioso tempo parado.",""),
["room_des_100901"] = New("room_des_100901","设备齐全的投球训练室，训练时注意别把钱包扔出去了。","A pitching training room with a variety of facilities. Be careful not to throw your wallet out during training.","ちゃんと整備されたピッチングルーム。お財布を投げ出さないよう気をつけましょう。","設備齊全的投球訓練室，訓練時注意別把錢包扔出去了。","Ein Pitching-Trainingsraum mit einer Vielzahl von Einrichtungen. Passen Sie auf, dass Sie Ihr Portemonnaie während des Trainings nicht wegwerfen.","Тренировочный зал для питчинга с разнообразными приспособлениями. Будьте осторожны, чтобы не выбросить свой кошелек во время тренировки.","Une salle d'entraînement au lancer avec de nombreux équipements. Faites attention à ne pas jeter votre portefeuille pendant l'entraînement.","Una sala di allenamento per i lanci con una varietà di attrezzature. Fai attenzione a non buttare fuori il tuo portafoglio durante l'allenamento.","Una sala de entrenamiento de lanzamientos con diversas instalaciones. Ten cuidado de no tirar la cartera durante el entrenamiento.","Uma sala de treino de pitching com uma variedade de instalações. Tenha cuidado para não deitar fora a sua carteira durante o treino.",""),
["room_des_101001"] = New("room_des_101001","咖啡厅是运动之余的放松圣地。","A place to relax after practicing.","カフェラウンジが運動後に寛ぐ聖地。","咖啡廳是運動之餘的放鬆聖地。","Ein Ort zum Entspannen nach dem Training.","Место для отдыха после тренировки.","Un endroit pour se détendre après l'entraînement.","Un posto per rilassarsi dopo l'allenamento.","Un lugar para relajarse después de practicar.","Um lugar para relaxar depois do treino.",""),
