["Roomvalue_desc_safety"] = New("Roomvalue_desc_safety","安保工作没做好时，捣蛋鬼会频繁到来。在保卫处指派球员、建造升级设备可以提升。","When security is poor， troublemakers will cause troubles in your club. Assign players and build or upgrade facilities in Security Office to improve sanitation.","警備が足りない場合、悪者がよく訪ねます。選手スタッフのアサイン、設備の新規建ておよびlvアップで強化できます。","安保工作沒做好時，搗蛋鬼會頻繁到來。在保衛處指派球員、建造升級設備可以提升。","Wenn die Sicherheit schlecht ist, werden Unruhestifter in Ihrem Club Probleme verursachen. Weisen Sie Spieler zu und bauen oder verbessern Sie die Einrichtungen im Sicherheitsbüro, um die Hygiene zu verbessern.","Когда безопасность низкая, нарушители спокойствия будут создавать проблемы в вашем клубе. Назначьте игроков и постройте или модернизируйте помещения в офисе безопасности, чтобы улучшить санитарные условия.","Lorsque la sécurité est insuffisante， les fauteurs de troubles causeront des problèmes dans votre club. Affectez des joueurs et construisez ou améliorez les installations du bureau de la sécurité pour améliorer l'hygiène.","Quando la sicurezza è scarsa, i piantagrane causeranno problemi nel tuo club. Assegna i giocatori e costruisci o aggiorna le strutture dell'Ufficio Sicurezza per migliorare le condizioni igieniche.","Cuando la seguridad es pobre， los alborotadores causarán problemas en su club. Asigna jugadores y construye o mejora las instalaciones en la Oficina de Seguridad para mejorar la sanidad.","Quando a segurança é poor， os arruaceiros causarão problemas no seu clube. Atribua jogadores e construa ou melhore instalações no Gabinete de Segurança para melhorar o saneamento.",""),
["Roomvalue_desc_cleanliness"] = New("Roomvalue_desc_cleanliness","场馆卫生太差时，垃圾会越来越多。在保洁室指派球员、建造升级设备可以提升。","When sanitation is poor your stadium will be infested with trash. Assign players and build or upgrade facilities in Janitor Room to improve sanitation.","衛生が足りない場合、ゴミがますます増えます。選手スタッフのアサイン、設備の新規建ておよびlvアップで強化できます。","場館衛生太差時，垃圾會越來越多。在保洁室指派球員、建造升級設備可以提升。","Wenn die sanitären Einrichtungen schlecht sind, wird dein Stadion mit Müll übersät sein. Ordne Spieler zu und baue oder verbessere die Einrichtungen im Hausmeisterraum, um die sanitären Einrichtungen zu verbessern.","При плохой санитарии ваш стадион будет завален мусором. Назначьте игроков и постройте или модернизируйте помещения в комнате уборщика, чтобы улучшить санитарные условия.","Si les conditions sanitaires sont mauvaises, votre stade sera infesté d'ordures. Affectez des joueurs et construisez ou améliorez les installations de la conciergerie pour améliorer l'hygiène.","Quando le condizioni igieniche sono scarse, il tuo stadio sarà infestato dalla spazzatura. Assegna i giocatori e costruisci o aggiorna le strutture nella Sala del custode per migliorare le condizioni igieniche.","Cuando el saneamiento es pobre, tu estadio estará infestado de basura. Asigna jugadores y construye o mejora las instalaciones de la Sala de Conserjería para mejorar la higiene.","Quando o saneamento é deficiente, o seu estádio será infestado de lixo. Designe jogadores e construa ou melhore instalações na Sala do Auxiliar para melhorar o saneamento.",""),
["Roomvalue_desc_upkeep"] = New("Roomvalue_desc_upkeep","设备保养没做好时，设备会磨损的更快。在工具间指派球员、建造升级设备可以提升。","When maintenance is poor， your facilities will deteriorate faster. Assign players and build or upgrade facilities in Tool Room to improve sanitation.","インフラが足りない場合、施設が壊れやすくなります。選手スタッフのアサイン、設備の新規建ておよびlvアップで強化できます。","設備保養沒做好時，設備會磨損的更快。在工具間指派球員、建造升級設備可以提升。","Wenn die Instandhaltung schlecht ist, werden deine Einrichtungen schneller verfallen. Setze Spieler ein und baue oder verbessere die Einrichtungen im Werkzeugraum, um die sanitären Anlagen zu verbessern.","При плохом обслуживании ваши объекты будут разрушаться быстрее. Назначьте игроков и постройте или модернизируйте объекты в Комнате инструментов, чтобы улучшить санитарные условия.","Lorsque l'entretien est mauvais， vos installations se détérioreront plus rapidement. Affectez des joueurs et construisez ou améliorez les installations de la salle des outils pour améliorer l'hygiène.","Quando la manutenzione è scarsa, le tue strutture si deteriorano più velocemente. Assegna i giocatori e costruisci o aggiorna le strutture nella Sala Attrezzi per migliorare le condizioni igieniche.","Cuando el mantenimiento es pobre, tus instalaciones se deteriorarán más rápido. Asigna jugadores y construye o mejora las instalaciones en la Sala de Herramientas para mejorar el saneamiento.","Quando a manutenção é feita em poor，, as suas instalações deteriorar-se-ão mais rapidamente. Atribua jogadores e construa ou melhore instalações na Sala de Ferramentas para melhorar o saneamento.",""),
["Roomvalue_desc_ardor"] = New("Roomvalue_desc_ardor","宣传力度不足时，自愿进入的游客会变少。在宣传部指派球员、建造升级设备可以提升。","When promotion is poor， the number of customers will decrease. Assign players and build or upgrade facilities in Marketing Department to improve sanitation.","営業宣伝が足りない場合、自動で入ってくる客が減ります。選手スタッフのアサイン、設備の新規建ておよびlvアップで強化できます。","宣傳力度不足時，自願進入的遊客會變少。在宣傳部指派球員、建造升級設備可以提升。","Wenn die Werbung schlecht ist, wird die Anzahl der Kunden abnehmen. Weisen Sie Spieler zu und bauen oder aktualisieren Sie Einrichtungen in der Marketingabteilung, um die Hygiene zu verbessern.","Когда продвижение плохое, количество клиентов будет уменьшаться. Назначьте игроков и постройте или модернизируйте помещения в отделе маркетинга, чтобы улучшить санитарные условия.","Lorsque la promotion est mauvaise， le nombre de clients va diminuer. Affectez des joueurs et construisez ou améliorez les installations du département marketing pour améliorer les conditions sanitaires.","Quando la promozione è scarsa, il numero di clienti diminuirà. Assegna i giocatori e costruisci o aggiorna le strutture nel reparto marketing per migliorare le condizioni igieniche.","Cuando la promoción es pobre, el número de clientes disminuirá. Asigne jugadores y construya o mejore las instalaciones en el Departamento de Marketing para mejorar el saneamiento.","Quando a promoção é poor，, o número de clientes diminuirá. Atribuir jogadores e construir ou melhorar instalações no Departamento de Marketing para melhorar o saneamento.",""),
["Roomvalue_desc_SQI"] = New("Roomvalue_desc_SQI","服务态度太差时，游客使用设备会更缓慢。在啦啦队休息室指派球员、建造升级设备可以提升。","When service attitude is poor， customers will spend more time on facilities. Assign players and build or upgrade facilities in Cheerleaders Lounge to improve sanitation.","サービスが足りない場合、設備を利用する客の時間が長くなります。選手スタッフのアサイン、設備の新規建ておよびlvアップで強化できます。","服務態度太差時，遊客使用設備會更緩慢。在啦啦隊休息室指派球員、建造升級設備可以提升。","Wenn die Einstellung zum Service schlecht ist, werden die Kunden mehr Zeit in den Einrichtungen verbringen. Weisen Sie Spieler zu und bauen oder verbessern Sie die Einrichtungen in der Cheerleaders Lounge, um die Hygiene zu verbessern.","Когда отношение к обслуживанию плохое, клиенты будут тратить больше времени на помещения. Назначьте игроков и постройте или модернизируйте помещения в зале для болельщиц, чтобы улучшить санитарные условия.","Lorsque l'attitude du service est mauvaise， les clients passeront plus de temps sur les installations. Affectez des joueurs et construisez ou améliorez les installations du salon des pom-pom girls pour améliorer les conditions sanitaires.","Quando l'attitudine al servizio è scarsa, i clienti passeranno più tempo nelle strutture. Assegnare i giocatori e costruire o aggiornare le strutture nella Cheerleaders Lounge per migliorare i servizi igienici.","Cuando la actitud de servicio es pobre, los clientes pasarán más tiempo en las instalaciones. Asigne jugadores y construya o mejore las instalaciones de la Sala de Animadoras para mejorar el saneamiento.","Quando a atitude de serviço é poor，, os clientes gastarão mais tempo nas instalações. Atribuir jogadores e construir ou melhorar instalações no Cheerleaders Lounge para melhorar o saneamento.",""),
["Roomvalue_desc_consume"] = New("Roomvalue_desc_consume","消费体验太差时，游客会偷偷拿走地上的钱。在财务处指派球员、建造升级设备可以提升。","When customer experience is poor， customers will steal the cash on the floor. Assign players and build or upgrade facilities in Finance Office to improve sanitation.","顧客体験が足りない場合、客がこっそりと地面に残る札を拾って去ります。選手スタッフのアサイン、設備の新規建ておよびlvアップで強化できます。","消費體驗太差時，遊客會偷偷拿走地上的錢。在財務處指派球員、建造升級設備可以提升。","Wenn die Kundenerfahrung schlecht ist, werden die Kunden das Bargeld auf dem Boden stehlen. Weisen Sie Spieler zu und errichten oder verbessern Sie die Einrichtungen im Finanzbüro, um die Hygiene zu verbessern.","При плохом отношении к клиентам клиенты будут воровать деньги на полу. Назначьте игроков и постройте или модернизируйте помещения в финансовом офисе, чтобы улучшить санитарные условия.","Lorsque l'expérience client est mauvaise， les clients voleront l'argent liquide sur le sol. Affectez des joueurs et construisez ou améliorez les installations du bureau des finances pour améliorer l'hygiène.","Quando l'esperienza del cliente è scarsa, i clienti rubano il denaro sul pavimento. Assegna i giocatori e costruisci o aggiorna le strutture dell'ufficio finanziario per migliorare le condizioni igieniche.","Cuando la experiencia del cliente es pobre, los clientes robarán el dinero en el suelo. Asigne jugadores y construya o mejore las instalaciones de la Oficina de Finanzas para mejorar el saneamiento.","Quando a experiência do cliente é poor，, os clientes roubarão o dinheiro no chão. Atribuir jogadores e construir ou melhorar instalações no Finance Office para melhorar o saneamento.",""),
["Roomvalue_management"] = New("Roomvalue_management","游客好感度","Customer Impression","客好感度","遊客好感度","Kundeneindruck","Впечатление клиента","Impression du client","Impressione del cliente","Impresión del cliente","Impressão do cliente",""),
["Roomvalue_management_fun"] = New("Roomvalue_management_fun","游客好感度过低会使俱乐部风评下降，导致俱乐部整体收益降低，反之则会使俱乐部整体收益提升。","A low customer impression harms your club’s reputation and results in a plummet in revenue， whereas a high customer impression boosts your revenue.","客好感度が低いと、クラブ全体の収入が低下します。逆の場合も然り。","遊客好感度過低會使俱樂部風評下降，導致俱樂部整體收益降低，反之則會使俱樂部整體收益提升。","Ein schlechter Kundeneindruck schadet dem Ruf Ihres Clubs und führt zu einem Rückgang der Einnahmen, während ein guter Kundeneindruck Ihre Einnahmen steigert.","Низкое впечатление клиентов вредит репутации вашего клуба и приводит к резкому падению доходов, в то время как высокое впечатление клиентов увеличивает ваши доходы.","Une mauvaise impression client nuit à la réputation de votre club et entraîne une chute des revenus， alors qu'une bonne impression client fait grimper vos revenus.","Una bassa impressione del cliente danneggia la reputazione del tuo club e si traduce in un crollo delle entrate, mentre un'alta impressione del cliente aumenta le tue entrate.","Una baja impresión del cliente daña la reputación de su club y resulta en una caída en picado de los ingresos， mientras que una alta impresión del cliente aumenta sus ingresos.","Uma baixa impressão do cliente prejudica a reputação do seu clube e resulta numa queda em revenue， enquanto que uma alta impressão do cliente aumenta as suas receitas.",""),
["Roomvalue_notice"] = New("Roomvalue_notice","游客好感度由六个部分组成，分别是场馆卫生、安保工作、设备保养、消费体验、服务态度和宣传力度。他们各自拥有不同的功能，他们的总和组成了游客好感度。","<size=60>Customer Impression</size> is composed of six factors: sanitation， security， maintenance， customer experience， service attitude， and promotion. Each factor is determined by multiple aspects.","客好感度は6つの部分から成り立てます。警備、衛生、インフラ、営業宣伝、サービス、顧客体験。それぞれの分野ですが、その合計で客好感度の値となります。","遊客好感度由六個部分組成，分別是場館衛生、安保工作、設備保養、消費體驗、服務態度和宣傳力度。他們各自擁有不同的功能，他們的總和組成了遊客好感度。","<size=60>Der Kundeneindruck</size> setzt sich aus sechs Faktoren zusammen: Hygiene, Sicherheit, Instandhaltung, Kundenerlebnis, Serviceeinstellung und Werbung. Jeder Faktor wird durch mehrere Aspekte bestimmt.","<size=60>Впечатление клиента</size> складывается из шести факторов: санитария, безопасность, обслуживание, опыт клиента, отношение к обслуживанию и продвижение. Каждый фактор определяется множеством аспектов.","<size=60>L'impression client</size> est composée de six facteurs : l'assainissement， la sécurité， l'entretien， l'expérience client， l'attitude de service， et la promotion. Chaque facteur est déterminé par de multiples aspects.","<size=60>L'impressione del cliente</size> è composta da sei fattori: igiene, sicurezza, manutenzione, esperienza del cliente, atteggiamento del servizio e promozione. Ogni fattore è determinato da molteplici aspetti.","<size=60>La impresión del cliente</size> se compone de seis factores: saneamiento, seguridad, mantenimiento, experiencia del cliente, actitud de servicio y promoción. Cada factor está determinado por múltiples aspectos.","<size=60>Customer Impression</size> é composto por seis factores: sanitation， security， maintenance， serviço ao cliente experience， attitude， e promoção. Cada factor é determinado por múltiplos aspectos.",""),
