["tipRoomvalue_upkeep"] = New("tipRoomvalue_upkeep","游客好感度中设备保养的加成，设备保养提升设备将不再容易损坏。","Maintenance bonus for customer impression. When maintenance is high， your facilities will no longer be easily damaged.","好感度のうちインフラの上昇効果として、設備の故障率が減少。","遊客好感度中設備保養的加成，設備保養提升設備將不再容易損壞。","Wartung Bonus für die Kunden Eindruck. Wenn die Wartung hoch ist, werden Ihre Einrichtungen nicht mehr so leicht beschädigt werden.","Бонус за обслуживание для впечатления клиента. При высоком уровне технического обслуживания ваши объекты больше не будут легко повреждаться.","Bonus de maintenance pour l'impression du client. Lorsque la maintenance est élevée， vos installations ne seront plus facilement endommagées.","Bonus manutenzione per l'impressione del cliente. Quando la manutenzione è alta, le tue strutture non saranno più facilmente danneggiate.","Bono de mantenimiento para la impresión del cliente. Cuando el mantenimiento es alto, tus instalaciones no se dañarán fácilmente.","Bónus de manutenção para a impressão do cliente. Quando a manutenção é high，, as suas instalações deixarão de ser facilmente danificadas.",""),
