["tipRoomvalue_SQI"] = New("tipRoomvalue_SQI","游客好感度中服务态度的加成，服务态度提升游客使用设备的速度会更快。","Service attitude bonus for customer impression. When service attitude is high， customers will finish using your facilities faster.","好感度のうちサービスの上昇効果として、客の設備利用時間が減少。","遊客好感度中服務態度的加成，服務態度提升遊客使用設備的速度會更快。","Service-Einstellung Bonus für den Kunden Eindruck. Wenn die Serviceeinstellung hoch ist, werden die Kunden die Nutzung Ihrer Einrichtungen schneller beenden.","Бонус за отношение к обслуживанию для впечатления клиентов. При высоком уровне обслуживания клиенты быстрее закончат пользоваться вашими объектами.","Bonus d'attitude de service pour l'impression du client. Si l'attitude de service est élevée， les clients finiront d'utiliser vos installations plus rapidement.","Bonus di servizio per l'impressione del cliente. Quando l'attitudine al servizio è alta, i clienti finiranno di usare le tue strutture più velocemente.","Bono de actitud de servicio para la impresión del cliente. Cuando la actitud de servicio es alta, los clientes terminarán de usar sus instalaciones más rápido.","Bónus de atitude de serviço para a impressão do cliente. Quando a atitude de serviço é high，, os clientes terminarão de utilizar as suas instalações mais rapidamente.",""),
["tipRoomvalue_consume"] = New("tipRoomvalue_consume","游客好感度中消费体验的加成，消费体验提升游客将不会偷走你的钱。","Customer experience bonus for customer impression. When customer service is high， customers will feel satisfied and no longer steal your cash.","好感度のうち顧客体験の上昇効果として、地面の札を盗むことが恥ずかしく思われます。","遊客好感度中消費體驗的加成，消費體驗提升遊客將不會偷走你的錢。","Kundenerfahrungsbonus für den Kundeneindruck. Wenn der Kundenservice hoch ist, werden die Kunden zufrieden sein und nicht mehr Ihr Geld stehlen.","Бонус за впечатления клиентов. При высоком уровне обслуживания клиенты будут чувствовать себя удовлетворенными и больше не будут воровать ваши деньги.","Bonus d'expérience client pour l'impression du client. Lorsque le service client est élevé， les clients se sentiront satisfaits et ne voleront plus votre argent.","Bonus esperienza del cliente per l'impressione del cliente. Quando il servizio clienti è alto, i clienti si sentiranno soddisfatti e non ruberanno più il tuo denaro.","Bono de experiencia del cliente para la impresión del cliente. Cuando el servicio al cliente es alto, los clientes se sentirán satisfechos y ya no robarán tu dinero.","Bónus de experiência do cliente para a impressão do cliente. Quando a atitude de serviço ao cliente é high， os clientes sentir-se-ão satisfeitos e deixarão de roubar o seu dinheiro.",""),
["tipRoomvalue_hook"] = New("tipRoomvalue_hook","球员训练的经验加成。","Player EXP bonus from training.","選手練習時の経験値上昇効果。","球員訓練的經驗加成。","Spieler-EXP-Bonus durch Training.","Бонус EXP игрока от обучения.","Bonus d'EXP du joueur grâce à l'entraînement.","Player EXP bonus dall'allenamento.","Bono de EXP del jugador por entrenamiento.","Bónus de EXP do jogador da formação.",""),
["tipRoomvalue_get"] = New("tipRoomvalue_get","持续运营收益加成。","Idling income bonus.","放置期間中の収入上昇効果。","持續運營收益加成。","Bonus auf das Einkommen im Leerlauf.","Бонус к доходу от простоя.","Bonus de revenu au ralenti.","Bonus al reddito da ozio.","Bonificación de ingresos por inactividad.","Bónus de rendimento de manuseamento.",""),
["tipRoomvalue_people"] = New("tipRoomvalue_people","每分钟进入职业棒球场的观众数量加成。","Bonus to the number of new audience per minute.","野球場に入ってくる観客の速度上昇効果。","每分鐘進入職業棒球場的觀眾數量加成。","Bonus auf die Anzahl der neuen Besucher pro Minute.","Бонус к количеству новых зрителей в минуту.","Bonus au nombre de nouveaux spectateurs par minute.","Bonus al numero di nuovo pubblico al minuto.","Bonificación al número de público nuevo por minuto.","Bónus para o número de novas audiências por minuto.",""),
["worktip_hallwaiter"] = New("worktip_hallwaiter","大厅内的服务员可提高俱乐部的持续收益，球员品质、等级与星级都会影响到加成效果。","Waiters in the lobby increase your idling income. Player’s tier,level and star rating will affect the bonus effect.","ロビーのスタッフが放置期間中のクラブを代わりに管理し、一定の収入を確保。スタッフのレアリティ、レベル、星lvがその効果に影響出します。","大廳內的服務員可提高俱樂部的持續收益，球員品質、等級與星級都會影響到加成效果。","Kellner in der Lobby erhöhen Ihr Einkommen im Leerlauf. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt.","Официанты в холле увеличивают ваш доход от безделья. Тир, уровень и звездный рейтинг игрока влияют на эффект бонуса.","Les serveurs dans le hall augmentent votre revenu d'oisiveté. L'effet du bonus dépend du niveau du joueur et de son classement par étoiles.","I camerieri nella lobby aumentano il tuo reddito da ozio. Il livello del giocatore, il livello e le stelle influiscono sull'effetto del bonus.","Los camareros en el vestíbulo aumentan tus ingresos por inactividad. El nivel del jugador, el nivel y el índice de estrellas afectarán al efecto de la bonificación.","Os empregados de mesa no lobby aumentam o seu rendimento em inactividade. O nível, nível e classificação de estrelas do jogador afectarão o efeito de bónus.",""),
["worktip_waiter"] = New("worktip_waiter","训练室内的服务员可减少游客使用设备的时间，球员品质、等级与星级都会影响到加成效果。","Waiters in practice rooms shorten customers' facility usage duration. Player’s tier,level and star rating will affect the bonus effect.","練習室のスタッフは客にサービスを提供し、施設の利用時間を短縮させる。スタッフのレアリティ、レベル、星lvがその効果に影響出します。","訓練室內的服務員可減少游客使用設備的時間，球員品質、等級與星級都會影響到加成效果。","Kellner in Übungsräumen verkürzen die Nutzungsdauer der Einrichtung für Kunden. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt.","Официанты в тренировочных залах сокращают время использования заведения клиентами. Уровень, уровень и звездность игрока влияют на бонусный эффект.","Les serveurs dans les salles d'entraînement raccourcissent la durée d'utilisation des installations par les clients. Le niveau, la catégorie et le nombre d'étoiles du joueur influencent l'effet du bonus.","I camerieri nelle sale d'aspetto accorciano la durata di utilizzo della struttura da parte dei clienti. Il livello del giocatore, il livello e le stelle influiscono sull'effetto del bonus.","Los camareros en las salas de prácticas acortan la duración del uso de las instalaciones por parte de los clientes. El nivel, el nivel y la puntuación del jugador afectan al efecto de la bonificación.","Os garçons nas salas de treino encurtam a duração de utilização das instalações dos clientes. O nível,nível e classificação por estrelas do jogador afectarão o efeito de bónus.",""),
["worktip_teawaiter"] = New("worktip_teawaiter","咖啡厅内的服务员可增加游客使用设备的收益，球员品质、等级与星级都会影响到加成效果。","Waiters in the coffee shop increase cash income from customers using facilities. Player’s tier,level and star rating will affect the bonus effect.","スタッフはカフェラウンジの客にサービスを提供し、札の収入を増やします。スタッフのレアリティ、レベル、星lvがその効果に影響出します。","咖啡廳內的服務員可增加遊客使用設備的收益，球員品質、等級與星級都會影響到加成效果。","Kellner im Coffeeshop erhöhen die Bareinnahmen von Kunden, die die Einrichtungen nutzen. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt.","Официанты в кофейне увеличивают денежный доход от клиентов, пользующихся услугами заведения. Уровень, уровень и звездность игрока влияют на бонусный эффект.","Les serveurs dans le café augmentent les revenus en espèces des clients qui utilisent les installations. Le niveau, la catégorie et le nombre d'étoiles du joueur ont une incidence sur l'effet de bonus.","I camerieri nella caffetteria aumentano le entrate in denaro dei clienti che usano le strutture. Il livello del giocatore, il livello e le stelle influiscono sull'effetto bonus.","Los camareros de la cafetería aumentan los ingresos en efectivo de los clientes que utilizan las instalaciones. El nivel del jugador, el nivel y la clasificación de estrellas afectan al efecto de la bonificación.","Os empregados de mesa na cafetaria aumentam o rendimento em dinheiro dos clientes que utilizam as instalações. O nível,nível e classificação por estrelas do jogador afectarão o efeito de bónus.",""),
["worktip_showerwaiter"] = New("worktip_showerwaiter","浴室内的服务员可增加游客使用设备的收益，球员品质、等级与星级都会影响到加成效果。","Waiters in shower rooms increase cash income from customers using facilities. Player’s tier,level and star rating will affect the bonus effect.","スタッフはバスルームを利用する客にサービスを提供し、札の収入を増やします。スタッフのレアリティ、レベル、星lvがその効果に影響出します。","浴室內的服務員可增加遊客使用設備的收益，球員品質、等級與星級都會影響到加成效果。","Kellner in Duschräumen erhöhen das Geldeinkommen von Kunden, die die Einrichtungen nutzen. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt.","Официанты в душевых комнатах увеличивают денежный доход от клиентов, пользующихся услугами заведения. Уровень, уровень и звездность игрока влияют на бонусный эффект.","Les serveurs dans les salles de douche augmentent les revenus en espèces des clients qui utilisent les installations. Le niveau, la catégorie et le nombre d'étoiles du joueur ont une incidence sur l'effet de bonus.","I camerieri nelle docce aumentano le entrate in denaro dei clienti che usano le strutture. Il livello del giocatore, il livello e le stelle influiscono sull'effetto bonus.","Los camareros de las duchas aumentan los ingresos en efectivo de los clientes que utilizan las instalaciones. El nivel del jugador, el nivel y la clasificación de estrellas afectarán al efecto de la bonificación.","Os empregados de mesa nos balneários aumentam os rendimentos em dinheiro dos clientes que utilizam as instalações. O nível,nível e classificação por estrelas do jogador afectarão o efeito de bónus.",""),
["worktip_coach"] = New("worktip_coach","教练可提升游客训练课程的收益，球员品质、等级与星级都会影响到加成效果。","Coaches increase cash income from training courses. Player’s tier,level and star rating will affect the bonus effect.","コーチは客に指導を与え、札の収入を増やします。スタッフのレアリティ、レベル、星lvがその効果に影響出します。","教練可提升遊客訓練課程的收益，球員品質、等級與星級都會影響到加成效果。","Trainer erhöhen die Geldeinnahmen aus Trainingskursen. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt.","Тренеры увеличивают денежный доход от тренировочных курсов. Уровень, уровень и звездность игрока влияют на бонусный эффект.","Les entraîneurs augmentent les revenus en espèces provenant des cours de formation. Le niveau, la catégorie et le nombre d'étoiles du joueur ont une incidence sur l'effet de bonus.","Gli allenatori aumentano le entrate in denaro dai corsi di formazione. Il livello del giocatore, il livello e le stelle influiscono sull'effetto bonus.","Los entrenadores aumentan los ingresos en efectivo de los cursos de entrenamiento. El nivel del jugador, el nivel y la clasificación de estrellas afectan al efecto de la bonificación.","Os treinadores aumentam os rendimentos em dinheiro dos cursos de formação. O nível,nível e classificação por estrelas do jogador afectarão o efeito de bónus.",""),
["worktip_guard"] = New("worktip_guard","保安可加成游客好感度中的安保工作值，球员品质、等级与星级都会影响到加成效果。保安在工作中时间内可自动赶走捣蛋鬼。","Guards improve security and thus raise customer impression. Player’s tier,level and star rating will affect the bonus effect. In addition guard will chase off troublemakers during their working hours.","警備員が客好感度のうち警備の上昇効果を持ちます。スタッフのレアリティ、レベル、星lvがその効果に影響出します。勤務時間中にクラブ中を巡らし、悪者を見つけたら追い払います。","保安可加成遊客好感度中的安保工作值，球員品質、等級與星級都會影響到加成效果。保安在工作中時間內可自動趕走搗蛋鬼。","Wachleute verbessern die Sicherheit und erhöhen damit den Eindruck bei den Kunden. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt. Außerdem verjagen Wachen während ihrer Arbeitszeit Störenfriede.","Охранники улучшают безопасность и тем самым повышают впечатление клиентов. Уровень, уровень и звездность игрока влияют на бонусный эффект. Кроме того, охранники отгоняют нарушителей порядка в рабочее время.","Les gardes améliorent la sécurité et augmentent ainsi l'impression des clients. Le niveau, la catégorie et le nombre d'étoiles du joueur influencent l'effet du bonus. En outre, les gardes chassent les fauteurs de troubles pendant leurs heures de travail.","Le guardie migliorano la sicurezza e quindi aumentano l'impressione dei clienti. Il livello del giocatore, il livello e la valutazione delle stelle influiscono sull'effetto bonus. Inoltre le guardie cacceranno i piantagrane durante le ore di lavoro.","Los guardias mejoran la seguridad y aumentan la impresión de los clientes. El nivel del jugador, el nivel y el número de estrellas afectan al efecto de la bonificación. Además, los guardias ahuyentan a los alborotadores durante sus horas de trabajo.","Os guardas melhoram a segurança e assim aumentam a impressão dos clientes. O nível,nível e classificação por estrelas do jogador afectarão o efeito de bónus. Além disso, os guardas perseguirão os arruaceiros durante o seu horário de trabalho.",""),
["worktip_parkguard"] = New("worktip_parkguard","停车场内的保安可增加每分钟进入职业棒球场的观众人数，球员品质、等级与星级都会影响到加成效果。","Guards in the parking lot increase the number of new audience entering the stadium per minute. Player’s tier,level and star rating will affect the bonus effect.","警備員が駐車場を管理して、球場に入る観客の速度を増やします。スタッフのレアリティ、レベル、星lvがその効果に影響出します。","停車場內的保安可增加每分鐘進入職業棒球場的觀眾人數，球員品質、等級與星級都會影響到加成效果。","Wächter auf dem Parkplatz erhöhen die Anzahl der neuen Zuschauer, die pro Minute das Stadion betreten. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt.","Охранники на парковке увеличивают количество новых зрителей, входящих на стадион в минуту. Тир, уровень и звездность игрока влияют на бонусный эффект.","Les gardiens du parking augmentent le nombre de nouveaux spectateurs entrant dans le stade par minute. Le niveau du joueur et le nombre d'étoiles influencent l'effet du bonus.","Le guardie nel parcheggio aumentano il numero di nuovi spettatori che entrano nello stadio al minuto. Il livello del giocatore, il livello e le stelle influiscono sull'effetto bonus.","Los guardias en el aparcamiento aumentan el número de nuevos espectadores que entran en el estadio por minuto. El nivel de los jugadores, el nivel y el índice de estrellas afectarán al efecto de la bonificación.","Os guardas no parque de estacionamento aumentam o número de novos espectadores que entram no estádio por minuto. O nível,nível e classificação por estrelas do jogador afectará o efeito de bónus.",""),
["worktip_cleaner"] = New("worktip_cleaner","清洁工可加成游客好感度中的场馆卫生，球员品质、等级与星级都会影响到加成效果。清洁工在工作时间内可自动清理垃圾。","Janitors improve sanitation and thus raise customer impression. Player’s tier,level and star rating will affect the bonus effect. In addition, janitors will remove trash during their working hours.","清掃員が客好感度のうち衛生の上昇効果を持ちます。スタッフのレアリティ、レベル、星lvがその効果に影響出します。勤務時間中にゴミを見かけたら掃除します。","清潔工可加成遊客好感度中的場館衛生，球員品質、等級與星級都會影響到加成效果。清潔工在工作時間內可自動清理垃圾。","Hausmeister verbessern die Sauberkeit und steigern so den Eindruck der Kunden. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt. Außerdem entfernen Hausmeister während ihrer Arbeitszeit den Müll.","Уборщики улучшают санитарные условия и тем самым повышают впечатление клиентов. Уровень, уровень и звездность игрока влияют на бонусный эффект. Кроме того, уборщики будут убирать мусор в рабочее время.","Les concierges améliorent l'hygiène et donc l'impression des clients. Le niveau du joueur et le nombre d'étoiles influencent l'effet du bonus. De plus, les concierges enlèveront les ordures pendant leurs heures de travail.","Gli inservienti migliorano l'igiene e quindi aumentano l'impressione dei clienti. Il livello del giocatore, il livello e le stelle influiscono sull'effetto bonus. Inoltre, gli inservienti rimuoveranno la spazzatura durante il loro orario di lavoro.","Los conserjes mejoran la higiene y, por tanto, aumentan la impresión de los clientes. El nivel del jugador, el nivel y el índice de estrellas afectan al efecto de la bonificación. Además, los conserjes retirarán la basura durante sus horas de trabajo.","Os contínuos melhoram o saneamento e, assim, aumentam a impressão do cliente. O nível,nível e classificação por estrelas do jogador afectarão o efeito de bónus. Além disso, os contínuos removerão o lixo durante o seu horário de trabalho.",""),
["worktip_cashier"] = New("worktip_cashier","收银员可加成游客好感度中的消费体验，球员品质、等级与星级都会影响到加成效果。收银员在工作时间内可自动拾取现金。","Cashiers improve customer experience and thus raise customer impression. Player’s tier,level and star rating will affect the bonus effect. In addition, cashiers will pick up cash from the ground during their working hours.","財務が客好感度のうち顧客体験の上昇効果を持ちます。スタッフのレアリティ、レベル、星lvがその効果に影響出します。勤務時間中に設備を使った後にお客さんが払った札を拾います。","收銀員可加成遊客好感度中的消費體驗，球員品質、等級與星級都會影響到加成效果。收銀員在工作時間內可自動拾取現金。","Kassierer verbessern das Kundenerlebnis und erhöhen so den Kundeneindruck. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt. Außerdem heben Kassierer während ihrer Arbeitszeit Bargeld vom Boden auf.","Кассиры улучшают обслуживание клиентов и тем самым повышают их впечатление. Уровень, уровень и звездность игрока влияют на бонусный эффект. Кроме того, в рабочее время кассиры будут подбирать деньги с земли.","Les caissiers améliorent l'expérience du client et augmentent ainsi son impression. Le niveau, la catégorie et le nombre d'étoiles du joueur ont une incidence sur l'effet de bonus. De plus, les caissiers ramasseront l'argent sur le sol pendant leurs heures de travail.","I cassieri migliorano l'esperienza del cliente e quindi aumentano l'impressione del cliente. Il livello del giocatore, il livello e la valutazione delle stelle influenzano l'effetto bonus. Inoltre, i cassieri raccoglieranno i contanti da terra durante il loro orario di lavoro.","Los cajeros mejoran la experiencia de los clientes y, por tanto, aumentan la impresión de los mismos. El nivel del jugador, el nivel y la puntuación de estrellas afectarán al efecto de la bonificación. Además, los cajeros recogerán el dinero del suelo durante sus horas de trabajo.","Os empregados de caixa melhoram a experiência do cliente e, assim, aumentam a impressão do cliente. O nível,nível e classificação por estrelas do jogador afectará o efeito de bónus. Além disso, os caixas irão levantar dinheiro do chão durante as suas horas de trabalho.",""),
["worktip_cheerleader"] = New("worktip_cheerleader","啦啦队员可加成游客好感度中的服务态度，球员品质、等级与星级都会影响到加成效果。啦啦队在工作时间内可获得额外的训练收益。","Cheerleaders improve service attitude and thus raise customer impression. Player’s tier,level and star rating will affect the bonus effect. In addition, cheerleaders will gain extra training benefits during their working hours.","応援団が客好感度のうちサービスの上昇効果を持ちます。スタッフのレアリティ、レベル、星lvがその効果に影響出します。勤務時間中に設備使用中の客からもっと料金が払ってくれます。","啦啦隊員可加成遊客好感度中的服務態度，球員品質、等級與星級都會影響到加成效果。啦啦隊在工作時間內可獲得額外的訓練收益。","Cheerleader verbessern das Serviceverhalten und erhöhen damit den Kundeneindruck. Die Stufe, das Level und die Sternebewertung des Spielers wirken sich auf den Bonuseffekt aus. Darüber hinaus erhalten Cheerleader während ihrer Arbeitszeit zusätzliche Trainingsvorteile.","Чирлидеры улучшают отношение к обслуживанию и тем самым повышают впечатление клиентов. Тир, уровень и звездный рейтинг игрока влияют на бонусный эффект. Кроме того, чирлидеры получат дополнительные бонусы за тренировки в рабочее время.","Les pom-pom girls améliorent l'attitude de service et augmentent ainsi l'impression du client. Le niveau, l'échelon et le classement par étoiles du joueur influencent l'effet du bonus. En outre, les pom-pom girls bénéficieront d'une formation supplémentaire pendant leurs heures de travail.","Le cheerleader migliorano l'attitudine al servizio e quindi aumentano l'impressione del cliente. Il livello del giocatore, il livello e la valutazione delle stelle influiscono sull'effetto bonus. Inoltre, le cheerleader otterranno benefici extra di formazione durante le loro ore di lavoro.","Las animadoras mejoran la actitud de servicio y, por tanto, aumentan la impresión del cliente. El nivel de los jugadores y su puntuación de estrellas afectarán al efecto de las bonificaciones. Además, las animadoras obtendrán beneficios de entrenamiento extra durante sus horas de trabajo.","As cheerleaders melhoram a atitude de serviço e, assim, aumentam a impressão do cliente. O nível,nível e classificação por estrelas do jogador afectarão o efeito de bónus. Além disso, as líderes de claque ganharão benefícios de formação extra durante as suas horas de trabalho.",""),
["worktip_manager"] = New("worktip_manager","经理可增加豪车老板的投资奖励，球员品质、等级与星级都会影响到加成效果。","Managers will persuade the Investor to increase his investment. Player’s tier,level and star rating will affect the bonus effect.","マネージャーがリッチランナーの投資を増加する効果を持ちます。スタッフのレアリティ、レベル、星lvがその効果に影響出します。","經理可增加豪車老闆的投資獎勵，球員品質、等級與星級都會影響到加成效果。","Manager werden den Investor dazu bewegen, seine Investition zu erhöhen. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt.","Менеджеры будут убеждать инвестора увеличить свои инвестиции. Уровень, уровень и звездность игрока влияют на бонусный эффект.","Les managers persuaderont l'investisseur d'augmenter son investissement. Le niveau, la catégorie et le nombre d'étoiles du joueur influencent l'effet du bonus.","I manager convinceranno l'investitore ad aumentare il suo investimento. Il livello del giocatore, il livello e la valutazione delle stelle influenzeranno l'effetto bonus.","Los directivos persuadirán al inversor para que aumente su inversión. El nivel del jugador, el nivel y la puntuación de las estrellas afectarán al efecto de la bonificación.","Os gestores persuadirão o Investidor a aumentar o seu investimento. O nível,nível e classificação de estrelas do jogador afectará o efeito bónus.",""),
["worktip_repairman"] = New("worktip_repairman","修理工可加成游客好感度中的设备保养，球员品质、等级与星级都会影响到加成效果。修理工在工作时间内可修好损坏的设备。","Mechanics improve maintenance and thus raise customer impression. Player’s tier,level and star rating will affect the bonus effect. In addition, mechanics will repair damaged facilities during their working hours.","整備士が客好感度のうちインフラの上昇効果を持ちます。スタッフのレアリティ、レベル、星lvがその効果に影響出します。勤務期間中に故障した設備を修理してくれます。","修理工可加成遊客好感度中的設備保養，球員品質、等級與星級都會影響到加成效果。修理工在工作時間內可修好損壞的設備。","Mechaniker verbessern die Instandhaltung und erhöhen so den Kundeneindruck. Die Stufe, das Level und die Sternebewertung des Spielers beeinflussen den Bonuseffekt. Darüber hinaus reparieren Mechaniker während ihrer Arbeitszeit beschädigte Einrichtungen.","Механики улучшают обслуживание и тем самым повышают впечатление клиентов. Уровень, уровень и звездность игрока влияют на бонусный эффект. Кроме того, механики будут ремонтировать поврежденные объекты в рабочее время.","Les mécaniciens améliorent la maintenance et augmentent ainsi l'impression des clients. Le niveau, la catégorie et le nombre d'étoiles du joueur ont une incidence sur l'effet de bonus. En outre, les mécaniciens réparent les installations endommagées pendant leurs heures de travail.","I meccanici migliorano la manutenzione e quindi aumentano l'impressione dei clienti. Il livello del giocatore, il livello e le stelle influiscono sull'effetto bonus. Inoltre, i meccanici ripareranno le strutture danneggiate durante le loro ore di lavoro.","Los mecánicos mejoran el mantenimiento y así aumentan la impresión de los clientes. El nivel del jugador y su puntuación de estrellas afectan al efecto de la bonificación. Además, los mecánicos repararán las instalaciones dañadas durante sus horas de trabajo.","A mecânica melhora a manutenção e, assim, aumenta a impressão do cliente. O nível,nível e classificação de estrelas do jogador afectará o efeito bónus. Além disso, os mecânicos irão reparar instalações danificadas durante o seu horário de trabalho.",""),
